values ('BASS_STD1_0131', '有价卡状态(VC)', '200', '激活状态', '在此状态下，用户可以通过拨打充值业务接入码或经由CRM系统进行充值，充值成功后该卡进入已使用状态。该状态有一定的有效期（生成卡时设置），如果超过有效期还没有充值，有价卡将进入过期状态。执行加锁操作，使该卡进入锁定状态。执行去激活操作，使该卡回到生成状态。');

